@gingerpianist_ Se quedó pensando aquella pregunta y dice- Duele es el apego a vivir Anna.

Nadie quiere morir realmente, hasta el suicida se arrepiente segundos antes de tocar el suelo. Pero si aceptas tu muerte, el desapego hará todo más fácil para que mueras.

Te recomiendo es que pongas+

